import Navigation from "../component/header/Navigations";
import { Card, Container } from 'react-bootstrap'

const Index = () => {
  return (
    <>
      <Navigation />
      <Container className="Index">
        <Card>
          <Card.Title> SEJARAH PT.MELIA SEHAT SEJAHTERA
          Sistem bisnis yang hebat tentunya akan lebih menguntungkan anda jika didukung oleh profil perusahaan yang kuat. Sebab tentunya anda tidak ingin mempertaruhkan harapan dan usaha untuk sukses dengan sebuah perusahaan yang tidak jelas. </Card.Title>
          <hr/>
          <Card.Body>
          <h1>Sejarah PT.ME</h1>

          </Card.Body>
        </Card>
      </Container>
    </>
  );
}

export default Index
